import { connect } from 'react-redux'
import ProdsPage from "../../pages/productsPage/productsPage"

const mapStateToProps = ({setFilters}) => {
    return {
        filterProducts : setFilters.filterProducts,
        sortProducts : setFilters.sortProducts
    }
  }


const ProductsPage = connect(mapStateToProps)(ProdsPage)

export default ProductsPage
